INSERT INTO `sysadmin_versionmgmt` VALUES (1,'beta1','2016-04-14 02:35:04','1. 支持API规范库功能；\n2. 支持API用例库功能；\n3. 支持Mock Server功能。'),(2,'beta2','2016-04-15 02:35:55','1. 支持NetEase openId认证；\n2. 支持从API规范库中复制API到Mock Server。'),(3,'beta3','2016-04-29 02:36:18','1. 在API规范库中支持通用定义、阅读模式等功能。'),(4,'beta4','2016-05-12 23:55:14','1. 在API规范库 -> 通用定义中，在数据结构加入关联静态常量功能；\n2. 在API规范库加入创建者，创建时间，最后修改者，最后修改时间，启用等字段。\n'),(5,'beta5','2016-06-03 17:39:20','1. 在API规范库增加搜索功能。\n2. 在通用定义和规范库中的引用关联位置加入快速查看功能。\n3. bug fix'),(6,'beta6','2016-06-21 15:48:44','1. 通用定义、API规范库支持版本管理。\n2. 不同版本之前的差异对比(左右对比、diff对比)。\n3. 查看历史版本的修改汇总\n\n'),(7,'beta6.1','2016-07-20 19:40:30','1. 在mock server加入响应延时功能\n2. 在mock server加入复制功能'),(8,'beta7','2016-07-28 14:13:08','1. 在API规范库、通用定义中加入review功能\n2. bug fix'),(9,'beta7.1','2016-09-05 18:19:44','1. 通用定义、API规范库支持按层级定义、展示数据结构，并自动生成数据示例。'),(10,'beta7.2','2016-10-31 14:50:21','1. 增加Jira燃尽图统计功能。'),(11,'beta7.3','2016-12-20 14:55:47','1. 增强燃尽图统计功能\n2. 在API用例库中增加认证功能。支持URS和花田认证。'),(12,'beta7.4','2017-01-03 18:14:03','在API规范库、通用定义中增加修改记录功能。'),(13,'beta7.5','2017-01-11 18:12:48','1. 在API规范库中加入默认请求头功能。\n2. 功能优化'),(14,'beta7.6','2017-02-20 21:52:09','1. 在API用例库中增加“检查点”功能；\n2. 测试报告改版，支持查看每个请求的详细信息(请求URL、请求头、请求参数，响应头、响应)，以及每个检查点的测试结果；\n3. 功能优化。'),(15,'beta7.7','2017-02-23 15:29:16','1. 在API用例库中增加\"调试\"功能。');
/*!40000 ALTER TABLE `sysadmin_versionmgmt` ENABLE KEYS */;
